import React from 'react';

const FeatureProductCard = ({ featureProduct }) => {
  return (
    <div className="card">
      <div
        className="image"
        style={{ backgroundImage: `url(${featureProduct.imageURL})` }}
      ></div>
      <div className="content">
        <h4>{featureProduct.title}</h4>
      </div>
    </div>
  );
};

export default FeatureProductCard;
